@prefix dc: <http://purl.org/dc/elements/1.1/> .
@prefix dcterms: <http://purl.org/dc/terms/> .
@prefix foaf: <http://xmlns.com/foaf/0.1/> .
@prefix skos: <http://www.w3.org/2004/02/skos/core#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

<http://data.europa.eu/eli/dir/2009/28/oj>
    a dcterms:Legislation ;
    dc:title "EU_32009L0028_Title_0_Chapter_0_Section_0_Article_04" .

<Template_for_National_Renewable_Energy_Action_Plans>
    skos:notation "4.1"^^xsd:string ;
    a dcterms:Standard ;
    dc:description """The Commission shall adopt a template for the national renewable energy action plans by 30 June 2009.""" .

<National_Renewable_Energy_Action_Plan_Notification>
    skos:notation "4.2"^^xsd:string ;
    a dcterms:Event ;
    dc:description """Member States shall notify their national renewable energy action plans to the Commission by 30 June 2010.""" ;
    dc:date "2010-06-30"^^xsd:date .

<Forecast_Document_Publication>
    skos:notation "4.3"^^xsd:string ;
    a dcterms:Event ;
    dc:description """Each Member State shall publish and notify to the Commission, six months before its national renewable energy action plan is due, a forecast document.""" ;
    dc:date "2009-12-31"^^xsd:date .

<Amended_National_Renewable_Energy_Action_Plan_Submission>
    skos:notation "4.4"^^xsd:string ;
    a dcterms:Event ;
    dc:description """A Member State whose share of energy from renewable sources fell below the indicative trajectory in the immediately preceding two-year period shall submit an amended national renewable energy action plan to the Commission by 30 June of the following year.""" .

<National_Renewable_Energy_Action_Plan_Evaluation>
    skos:notation "4.5"^^xsd:string ;
    a dcterms:Event ;
    dc:description """The Commission shall evaluate the national renewable energy action plans, notably the adequacy of the measures envisaged by the Member State in accordance with Article 3(2).""" .

<Recommendation_Issuance>
    skos:notation "4.5"^^xsd:string ;
    a dcterms:Event ;
    dc:description """In response to a national renewable energy action plan or to an amended national renewable energy action plan, the Commission may issue a recommendation.""" .

